import styled from "styled-components";


export const Wrapper = styled.div `
	font-size: 1em;
	height: 100vh;
	width: 100vw;
	text-align: center;

`;

export const Content = styled.div `
	display:flex;
	flex-direction: row;
	width: 100vw;
	height: 100vh;
	background-color: #3776ab;

`;

export const WelcomeMessage = styled.div `
	flex:1;
	padding-top: 2em;
	height: 5em;
	align-content: left;
	h2 {
		align-items: left;
		max-width: 12em;
		max-height: 2em;
		margin: 0;
	}
`;

export const NewBikePic = styled.div `
	flex:2;
	height: 5em;
`;

export const LoadAtHomePic = styled.div `
	flex:3;
	height: 5em;
`;


export const EnvironmentPic = styled.div `
	flex:4;
	height: 5em;
`;
